import React from 'react';
import './style.css';
import BG from '../../image/spkt.jpg';
import { Link} from "react-router-dom";

HomeFeature.propTypes = {
    
};

function HomeFeature(props) {
    return (
      <div className='login-form'>
        <div className='bg-group'>
          <p className='greeting'><b>Chào mừng đến với<br/>UTECLUBS</b></p>
          <img className='background' src={BG}/>
        </div>

        <div className='login'>
          <p><b>Đăng nhập để tiếp tục</b></p><br/>
          <Link className='login-link' to='/login'><b>ĐĂNG NHẬP</b></Link>
        </div>
      </div>
    );
}

export default HomeFeature;
